import { useEffect, useState } from "react";


function OTP3(){
    const[data,Setdata]=useState(null)

    useEffect(()=>{
        fetch("http://localhost:3008/otp")
        .then((navi)=>{
            return navi.json()

        })
        .then((chinna)=>{
            console.log(chinna)
            
            Setdata(chinna)
        })
      
    },[])
    return(
        <div style={{backgroundColor:"skyblue"}}>
            <h4>Mobile Number List</h4>
            <table>
                <th>
                    <tr>
                        <td>Email / phone Number</td>
                        <td>Action</td>
                    </tr>
                </th>
                <tbody>
                   {data && data.map((aaa)=>(
                    <tr key={aaa.id}>
                        <td>{aaa.id}</td>
                        <td>{aaa.Email}</td>
                        <td>delete</td>
                    </tr>
                   ))}
                </tbody>
            </table>

        </div>
    )
}
export default OTP3;
